import React from "react";
import Header from "./Header";
import Weather from "./Weather";
import Footer from "./Footer"

export default function App() {

  const [search, setSearch] = React.useState()

  return (
    <div className="app">
      <Header setSearch={setSearch} />
      {search &&
        <>
          <Weather />
          <Footer />
        </>
      }
    </div>
  );
}
